import { MainBodyI } from "../interfaces/MainBodyI";
import { MainBodyBox } from "../style";
import { Footer } from "./Footer";
import { Header } from "./Header";

export const MainBody = ({ children }: any) => {
  return (
    <MainBodyBox>
      <Header />
      {children}
      <Footer />
    </MainBodyBox>
  );
};
